import React from 'react';
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';

function Items({ itemsname }) {
    return (
        <div className='d-flex'>
            <h6>{itemsname}</h6>
            <button className='ms-auto'> <DeleteOutlineIcon/></button>
            <button> </button>
        </div>
    );
}

export default Items;
